    // Jquery Carousel
    function supermartket_init_owl_carousel() {

        $('.supermartket-owl-carousel').each(function () {

            var $this = $(this),
                $loop = $this.attr('data-loop') == 'yes',
                $numberItem = parseInt($this.attr('data-number')),
                $Nav = $this.attr('data-navcontrol') == 'yes',
                $Dots = $this.attr('data-dots') == 'yes',
                $autoplay = $this.attr('data-autoplay') == 'yes',
                $autoplayTimeout = parseInt($this.attr('data-autoplaytimeout')),
                $marginItem = parseInt($this.attr('data-margin')),
                $rtl = $this.attr('data-rtl') == 'yes',
                $autoHeight = $this.attr('data-autoheight') == 'yes',
                $resNumber = {
                    0: {
                        items: 1
                    }
                }; // Responsive Settings

            $numberItem = (isNaN($numberItem)) ? 1 : $numberItem;
            $autoplayTimeout = (isNaN($autoplayTimeout)) ? 6000 : $autoplayTimeout;
            $marginItem = (isNaN($marginItem)) ? 0 : $marginItem;

            if (!$this.is('.owl-carousel')) {
                $this.addClass('owl-carousel');
            }

            //console.log($Nav);

            switch ($numberItem) {

                case 1 :
                    $resNumber = {
                        0: {
                            items: 1
                        }
                    }
                    break;

                case 2 :
                    $resNumber = {
                        0: {
                            items: 1
                        },
                        480: {
                            items: 1
                        },
                        768: {
                            items: 2
                        },
                        992: {
                            items: $numberItem
                        }
                    }
                    break;

                case 3 :
                    $resNumber = {
                        0: {
                            items: 1
                        },
                        400: {
                            items: 2
                        },
                        480: {
                            items: 2
                        },
                        768: {
                            items: 3
                        },
                        992: {
                            items: 3
                        },
                        1200: {
                            items: $numberItem
                        }
                    }
                    break;
                case 4 :
                    $resNumber = {
                        0: {
                            items: 1
                        },
                        480: {
                            items: 2
                        },
                        768: {
                            items: 3
                        },
                        992: {
                            items: 3
                        },
                        1200: {
                            items: $numberItem
                        }
                    }
                    break;
                case 5 :
                    $resNumber = {
                        0: {
                            items: 1
                        },
                        480: {
                            items: 2
                        },
                        768: {
                            items: 3
                        },
                        992: {
                            items: 3
                        },
                        1200: {
                            items: $numberItem
                        }
                    }
                    break;
                default : // $numberItem > 4
                    $resNumber = {
                        0: {
                            items: 1
                        },
                        480: {
                            items: 2
                        },
                        768: {
                            items: 3
                        },
                        992: {
                            items: 3
                        },
                        1024: {
                            items: 5
                        },
                        1280: {
                            items: 6
                        },
                        1800: {
                            items: $numberItem
                        }
                    }
                    break;
            } // Endswitch


            $(this).owlCarousel({
                items: $numberItem,
                loop: $loop,
                nav: $Nav,
                navText: ['<span class="fa fa-angle-left"></span>', '<span class="fa fa-angle-right"></span>'],
                navContainer: false,
                dots: $Dots,
                autoplay: $autoplay,
                autoplayTimeout: $autoplayTimeout,
                autoHeight: $autoHeight,
                margin: $marginItem,
                //responsiveClass:true,
                rtl: $rtl,
                responsive: $resNumber,
                autoplayHoverPause: true,

                //center: true,
                onRefreshed: function () {
                    var total_active = $this.find('.owl-item.active').length;
                    var i = 0;

                    $this.find('.owl-item').removeClass('active-first active-last');
                    $this.find('.owl-item.active').each(function () {
                        i++;
                        if (i == 1) {
                            $(this).addClass('active-first');
                        }
                        if (i == total_active) {
                            $(this).addClass('active-last');
                        }
                    });
                },
                onTranslated: function () {
                    var total_active = $this.find('.owl-item.active').length;
                    var i = 0;

                    $this.find('.owl-item').removeClass('active-first active-last');
                    $this.find('.owl-item.active').each(function () {
                        i++;
                        if (i == 1) {
                            $(this).addClass('active-first');
                        }
                        if (i == total_active) {
                            $(this).addClass('active-last');
                        }
                    });
                },
                onResized: function () {
                    //essence_set_equal_columns();
                }
            });

        });
    }

